import { BrowserRouter } from 'react-router-dom';

import "./styles/App.css"
import Logo from './components/Template/Logo';
import Routes from './Routes';

function App() {
  return (
    <>
    <BrowserRouter>
    <div className="app">
      <Logo/>
   <Routes/>
   <h1>1</h1>
   <h2>2</h2>
   <h3>3</h3>
   <h4>4</h4>
   </div>
    </BrowserRouter>
   </>
  )
}

export default App;
